import Inbox from './components/Inbox/Inbox';
import {  Route, Routes } from 'react-router-dom';

function App() {
  return(
    <div className='App'>
      {/* <BrowserRouter> */}
        <Routes>
          <Route exact path="/" element={<Inbox />} />
          <Route exact path="/?page=1/:id" element={<Inbox split={true}/>} />
        </Routes>
      {/* </BrowserRouter> */}
    </div>
  )
}

export default App;
